import React from 'react';
import { Box, Typography } from '@material-ui/core';

const SkillsData = [{
    barTitle: "HTML",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "CSS",
    barClassName: "progress-bar bg-success progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "JavaScript",
    barClassName: "progress-bar bg-warning progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "JQuery",
    barClassName: "progress-bar bg-danger progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "Bootstrap",
    barClassName: "progress-bar bg-info progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "React Js",
    barClassName: "progress-bar bg-success progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "Wordpress",
    barClassName: "progress-bar bg-secondary progress-bar-striped progress-bar-animated",
    barWidth: "90%"
}]

const Skills = () => {
    return (<>
        {SkillsData.map((item, index) => {
            return (<Box>
                <Typography variant="h6">{item.barTitle}</Typography>
                <div className="progress">
                    <div className={item.barClassName} style={{ width: item.barWidth }}>100%
                    </div>
                </div>
            </Box>)
        })}
    </>)
}

export default Skills
